import investpy
import pandas as pd
import os

# stock : 주식
# indices : 지수
# bonds : 채권
# commodities : 선물
# crypto : 가상화폐
# currency_crosses : 환율

KOREA = 'south korea'
US = 'united states'
KOSPI_PATH = 'dataset/kospi/'
NASDAQ_PATH = 'dataset/nasdaq/'


def get_stock():
    error = {}
    new_df = pd.DataFrame()
    kospi_list = os.listdir(KOSPI_PATH)
    start_index = -1
    for i in range(len(kospi_list)):
        symbol = kospi_list[i]
        print(symbol)
        if len(symbol) == 10:
            if start_index == -1:
                start_index = i
            try:
                df = pd.read_csv(KOSPI_PATH + symbol)
                df.set_index(df['Date'], inplace=True)
                df = df.drop(['Date', 'High', 'Low', 'Close',
                              'Adj Close', 'Volume'], axis=1)
                symbol = symbol[:-4]
                stock = investpy.stocks.get_stock_historical_data(
                    symbol, KOREA, from_date="08/07/2017", to_date="09/04/2020")
                stock = stock.drop(
                    ['Close', 'High', 'Low', 'Volume', 'Currency'], axis=1)
                merge = pd.concat([df, stock])
                if start_index > -1:
                    new_df = merge
                    new_df.rename(columns={'Open': symbol}, inplace=True)
                    start_index = -2
                else:
                    new_df[symbol] = merge['Open']
            except:
                error[symbol] = 1
    new_df.to_csv(KOSPI_PATH + 'kospi_total_dataset.csv', mode='w')


def get_stock_nasdaq():
    error = []
    new_df = pd.DataFrame()
    stock_list = os.listdir(NASDAQ_PATH + 'full_history/')
    for i in range(len(stock_list)):
        try:
            symbol = stock_list[i]
            print(symbol)
            df = pd.read_csv(NASDAQ_PATH + 'full_history/' + symbol)
            df.set_index(df['date'], inplace=True)
            df = df.drop(['date', 'high', 'low', 'close',
                          'adjclose', 'volume'], axis=1)
            symbol = symbol[:-4]
            df.rename(columns={'open': 'Open'}, inplace=True)
            stock = investpy.stocks.get_stock_historical_data(
                symbol, US, from_date="18/04/2019", to_date="09/04/2020")
            stock = stock.drop(
                ['Close', 'High', 'Low', 'Volume', 'Currency'], axis=1)
            merge = pd.concat([df, stock])
            if i == 0:
                new_df = merge
                new_df.rename(columns={'open': symbol}, inplace=True)
            else:
                new_df[symbol] = merge['Open']
        except:
            error.append(symbol)
    new_df.to_csv(NASDAQ_PATH + 'nasdaq_total_dataset.csv', mode='w')
    print(error)


get_stock_nasdaq()
